import React from "react";
import styles from "./NavBar.module.css";
export const NavBar = () => {
  return (
    <div>
      <div className={styles.header}>
        <div className={styles.logo}>
          <img src="../../img/Logo.png" alt="Logo" />
        </div>
        <div>
          <ul>
            <li>
              <a href="">Services</a>
            </li>
            <li>
              <a href="">Proyects</a>
            </li>
            <li>
              <a href="">About</a>
            </li>
          </ul>
        </div>
      </div>
    </div>
  );
};
